window.bookSummaryJSON = "<p>A crimson sky. A plague approaching. Violence on the horizon. A world in desperate need of a warrior. Oric Rune must rise to this challenge or lose everything he’s ever held dear.&nbsp;&nbsp;</p> <p>Joining him on his journey are his large black wolf, a mysterious female solar mage, a scholarly giant, and Sam Raid, the woman who might just hold the key to saving Unigaea.&nbsp;&nbsp;</p> <p>The audiobook series that started it all for Soundbooth Theater is now available in one audiobook! This is Annie Ellicott’s debut role and the first multicast performance released by this burgeoning production house. The gruff narration of Jeff Hays blends with Annie’s sweet yet commanding delivery to perfectly set the tone for this heartfelt tale set in a harsh world.</p>"; 
